tables.table_schema:
CREATE TABLE training_data (
    id INT PRIMARY KEY,
    features TEXT,
    label VARCHAR(255)
);

CREATE TABLE model_info (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    training_accuracy FLOAT
);

CREATE TABLE training_data (
    id INT PRIMARY KEY,
    input_data TEXT,
    output_data TEXT
);

CREATE TABLE training_data (
    id INT PRIMARY KEY,
    input_features VARCHAR(255),
    target_variable VARCHAR(50),
    created_at TIMESTAMP
);

CREATE TABLE model_params (
    model_id INT,
    hyperparameters JSON,
    created_at TIMESTAMP,
    PRIMARY KEY (model_id, created_at)
);

CREATE TABLE training_data (
    id SERIAL PRIMARY KEY,
    feature_1 FLOAT,
    feature_2 FLOAT,
    target_label VARCHAR(50)
);

CREATE TABLE model_parameters (
    model_id SERIAL PRIMARY KEY,
    learning_rate FLOAT,
    optimizer VARCHAR(50),
    loss_function VARCHAR(50)
);

CREATE TABLE training_logs (
    log_id SERIAL PRIMARY KEY,
    model_id INT REFERENCES model_parameters(model_id),
    epoch INT,
    accuracy FLOAT
);

CREATE TABLE model_evaluation (
    evaluation_id SERIAL PRIMARY KEY,
    model_id INT REFERENCES model_parameters(model_id),
    evaluation_metric VARCHAR(50),
    metric_value FLOAT
);
